import React from "react"
import axios from "axios"

function App() {
  const [color, colorSet] = React.useState("");
  const url = "https://www.colr.org/json/color/random?timestamp=${new Date().getTime()}";

  React.useEffect(() => {}, [color]);

  const getEm = () => {
    axios
      .get(url)
      .then((rez) => {
        colorSet(rez.data);
      })
      .catch((err) => {
      });
  };
  console.log(color);
return (
  <div>
  <App />
  <button style={{ background: `# + ${color}` }} onClick={() => getEm()}>Randomize</button>
</div>
)
}
 export default App;
